# torna todas as sublistas e seus elementos independentes da lista passada para o parametro
def listaIndependente( lista ):
    aux = []
    for e in lista:
        if ( type(e).__name__ == 'list' ):
            aux += [listaIndependente( e )]
        else:
            
            aux += [e]
    return aux


def simplifica():
    var=0
    global listaReseva
    #percorre toda a formula a proucura de uma clausula tam=1
    while var<len(listaCompleta):
        if len(listaCompleta[var])==1:
            #seleciona o literal
            selecionado=listaCompleta[var][0]
            #seleciona o negativo do literal
            selecionadoNegativo=[-listaCompleta[var][0][0]]
            var2=0
            var3=0
            #percorre a formula
            while var2<len(listaCompleta):
                unico=0
                #percorre clausula
                while var2<len(listaCompleta) and unico<len(listaCompleta[var2]):
                    #se encontrar uma listinha igual ao literal, apaga clausula da formula
                    if(listaCompleta[var2][unico]==selecionado):
                        listaCompleta.remove(listaCompleta[var2])
                        unico=0
                    #se encontrar uma listinha com o negativo do literal, apaga somente o literal
                    elif (listaCompleta[var2][unico]==selecionadoNegativo):
                        if(len(listaCompleta[var2])==1):
                            return False
                        else:
                            listaCompleta[var2].remove(listaCompleta[var2][unico])
                            unico=0
                    else:
                        unico+=1
                var2+=1
            while var3<len(listaCompleta2):
                unico2=0
                #percorre a listaCompleta2
                while var3<len(listaCompleta2) and unico2<len(listaCompleta2[var3]):
                    #se encontrar uma listinha igual ao literal, apaga a lista do listao
                    if(listaCompleta2[var3][unico2]==selecionado):
                        listaCompleta2.remove(listaCompleta2[var3])
                        unico2=0
                    #se encontrar uma listinha com o negativo do literal, apaga somente o literal
                    elif (listaCompleta2[var3][unico2]==selecionadoNegativo):
                        #print("igualnegativo")
                        if(len(listaCompleta2[var3])==1):
                            return False
                        else:
                            listaCompleta2[var3].remove(listaCompleta2[var3][unico2])
                            unico2=0
                    else:
                        unico2+=1
                var3+=1
            var=0
        else:
            var+=1

